import React, { useEffect, useState } from 'react';
import Web3 from 'web3';
import Table from 'react-bootstrap/Table';

export default function EGOLDConfig() {

    const [accounts, setAccounts] = useState(null);
    const [contract, setContract] = useState(null);

    const [perEGOLD, setPerEGOLD] = useState("");

    const [EGOLDprice, setEGOLDprice] = useState("");

    useEffect(() => {
        setTimeout(async () => {
            const artifact = require(`../contracts/EGOLD.json`);
            const _web3 = new Web3(Web3.givenProvider);
            const _accounts = await _web3.eth.requestAccounts();
            const networkID = await _web3.eth.net.getId();
            const { abi } = artifact;
            let address, contract;
            try {
                address = artifact.networks[networkID].address;
                contract = new _web3.eth.Contract(abi, address);
            } catch (err) {
                console.error(err);
            }
            setAccounts(_accounts);
            setContract(contract);
        }, 100)

    }, [])

    const getDataHandler = async () => {
        await contract.methods.EGoldPrice().call({ from: accounts[0] })
            .then(e => {
                //console.log(e);
                setPerEGOLD(e);
            })
            .catch(err => console.log(err));
        await contract.methods._EINR().call({ from: accounts[0] })
            .then(e => {
                //console.log(e);
                setEINRAdd(e);
            })
            .catch(err => console.log(err));
    }

    const setEGOLDPriceHandler = (e) => {
        setEGOLDprice(e.target.value);
    }

    const setEGOLD = async () => {
        await contract.methods.setGoldPrice(EGOLDprice)
            .send({
                from: accounts[0]
            })
            .then(e => {
                //console.log(e);
            })
            .catch(err => console.log(err));
        getDataHandler();
        setEGOLDprice("");
    }


    const setEINRaddHandler = (e) => {
        setEINRadd(e.target.value);
    }

    const setEINR = async () => {
        await contract.methods.setEINR(EINRadd)
            .send({
                from: accounts[0]
            })
            .then(e => {
                //console.log(e);
            })
            .catch(err => console.log(err));
        getDataHandler();
        setEINRadd("");
    }

    return (
        <div>
            <Table striped bordered hover>
                <thead>
                    <tr>
                        <th>#</th>
                        <th>Contract Name</th>
                        <th>Contract Address</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>1</td>
                        <td>EGOLD</td>
                        <td>{EGOLDAdd && EGOLDAdd}</td>
                    </tr>
                </tbody>
                <tbody>
                    <tr>
                        <td>2</td>
                        <td>EINR</td>
                        <td>{EINRAdd && EINRAdd}</td>
                    </tr>
                </tbody>
            </Table>
            <h1>Data</h1>
            <Table striped bordered hover>
                <tbody>
                    <tr>
                        <th>1</th>
                        <th>Per EGOLD Price</th>
                        <td>{perEGOLD}EINR</td>
                    </tr>
                </tbody>
            </Table>
            <div style={{gap: "100px"}}>
                <label><h1>Set EGOLD Price</h1></label><br />
                <input onChange={setEGOLDPriceHandler} value={EGOLDprice} />
                <button onClick={setEGOLD}>Set</button> <br />
                <label><h1>Set EINR Add</h1></label><br />
                <input onChange={setEINRaddHandler} value={EINRadd} />
                <button onClick={setEINR}>Set</button> <br />
            </div>
        </div>
    )
}
